import { Link } from 'react-router-dom';

export default function Navbar() {
    return (
        <>
            <nav>
                <div>
                    <Link to = '/'>
                        JAVIS <i className = 'fab fa-typo3' />
                    </Link>
                </div>
            </nav>
        </>
    )
}
